import Login from '../src/Components/Login/Login'
import ChatBox from '../src/Components/ChatBox/index'
import { BrowserRouter as Router, Route } from 'react-router-dom'
import LoginX from './Components/NewLogin/Login'
import LoginRegister from './Components/NewLoginRegister/LoginRegister'
import Room from './Components/NewRoom/Room'
import RoomRegister from './Components/NewRoomRegister/RoomRegister'
function App() {
	return (
		// <Router>
		// 	<Route exact path='/' component={Login}></Route>
		// 	<Route path='/chat/:room' component={ChatBox}></Route>
		// </Router>
		// <LoginX />

		<Router>
			<Route exact path='/login' component={LoginX} />
			<Route exact path='/login/signup' component={LoginRegister} />
			<Route path='/chat/:room' component={ChatBox}></Route>
			<Route path='/oke' children={<h1>oke</h1>}></Route>
			<Route path='/room' component={Room} />
			<Route path='/room/create' component={RoomRegister} />
		</Router>
	)
}

export default App
